end_color.script:
'use strict';

let custom_colors = false;
const default_color = new Vec3(0.3, 0.78, 0.76);
let end_color = default_color.copy();

/**
 * @param {Object} userProperties
 */
export function applyUserProperties(userProperties) {
	if (userProperties.custom_colors != undefined)
		custom_colors = userProperties.custom_colors;
	if (userProperties.prism_gradient_2 != undefined)
		end_color = userProperties.prism_gradient_2;

	if (custom_colors)
		thisObject.end_color = end_color.copy();
	else
		thisObject.end_color = default_color.copy();
}

